import React from 'react'

// import link
import { Link } from 'react-router-dom'
// import images
import intLOGO from '../../assets/images/interactlogo.SVG'
// import components

const Header = () => {
  return (
    <>
    <div className="flex justify-between items-center h-20 px-4">
      <div className="">
          {/* logo */}
          <Link to='/homepage'>
            <img src={intLOGO} alt="" />
          </Link>
      </div>

        {/* Navigations */}
        <ul className='flex gap-6 text-[17px] font-[500]'>
          <li>Home</li>
          <li>About</li>
          <li>Activities</li>
          <li>Contact</li>
        </ul> 
        {/* User */}
      <div className="flex">
      <span>@username</span><i class="ri-user-line"></i>
      </div>
    </div>
    
    </>
  )
}

export default Header
